import React from 'react';
import './Experience.css'; // Import your CSS file

const Experience = () => {
  return (
    <div className="experience-container">
      <h2 className="section-title">EXPERIENCE</h2>
      <div className="experience-item">
        <h3 className="position-title">Full Stack Engineering Intern, Inward</h3>
        <p className="date">October 2022 â€“ December 2022</p>
        <ul className="responsibilities">
          <li>Organized and exported over 70 contacts worth of data from Keap for simplified analysis</li>
          <li>Collaborated with co-founders to develop a list of valuable company web modifications</li>
          <li>Executed website changes including recategorizing information and pages</li>
          <li>Analyzed company data and implemented UTM tracking via Google Analytics to increase customer conversion</li>
        </ul>
      </div>
      {/* Add other experience items similarly */}
    </div>
  );
};

export default Experience;
